    if(props.diKlik == "true"){
        console.log(props.diklik)
        ret = <svg viewBox="0 0 24 24" fill="#FFFFFF"><path d="M0 0h24v24H0z" fill="none"/><path d="M10 20v-6h4v6h5v-8h3L12 3 2 12h3v8z"/></svg>
    }
    return(
        <>{ret}</>
    );
}

export default HomeIcon;
